import Modal from 'react-bootstrap/Modal';
import React, { useState, useEffect } from "react";
import ReactDOM from "react-dom";
import Button from 'react-bootstrap/Button';
import {MDBBtn, MDBIcon} from 'mdbreact';

import GetService from '../components/apis/get.service';

function Display(objectID) {




    //const resp = GetService.getInfoDetails(objectID.value);
    //console.log(resp);
    var resp="";
    var title="";
    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => {

      console.log(objectID);
      GetService.getInfoDetails(objectID.value).then((details)=>{
        resp=details;
      });
      console.log("Response Details aus GETSERVICE");
      console.log(resp);
      title = resp.mycoreoject.metadata[0]["def.title"][0].title[0]["_"] 
      console.loge(title);
      setShow(true);
    };



    return (
      <>

        <MDBBtn class="btn btn-success" onClick={handleShow}>
          Anzeige
        </MDBBtn>

        <Modal
          size="lg"
          show={show}
          onHide={() => setShow(false)}
          aria-labelledby="example-modal-sizes-title-lg"
          centered
        >
          <Modal.Header closeButton>
            <Modal.Title id="example-modal-sizes-title-lg">
              Information
            </Modal.Title>
          </Modal.Header>
          <Modal.Body>
            BodyContent {title}
          </Modal.Body>
          <Modal.Footer>
            <Button variant="dark" class="btn btn-dark" onClick={handleClose}>
              Schlie√üen
            </Button>
        </Modal.Footer>
        </Modal>
      </>
    );
  }

export default Display;
